import axios from 'axios';
class Users{

getusers(token){
        let response = axios.get('http://localhost:9082/api/app/auth',{
            headers:{
                'AUTHORIZATION': `Bearer ${token}`
            }
        });
        return response;
}



postroomward(Roomward){
    let response =axios.post (`http://localhost:9082/api/roomwardDetails`,Roomward);
    return response;
}



deleteuser(UserId)
{
    let response =axios.delete(`http://localhost:9082/api/app/auth/${UserId}`)
    return response;
}

}
export default Users;
